using BenchmarkDotNet.Attributes;
using BenchmarkDotNet.Running;
using System;

namespace Wsq.Managed.Benchmark
{
    public class DecodeBenchmark
    {
        private readonly IWsqDecoder _wsq;
        private readonly byte[] wsqBytes;
        public DecodeBenchmark()
        {
            var wsq = "";
            wsqBytes = Convert.FromBase64String(wsq);

            _wsq = new WsqDecoder();
        }

        [Benchmark]
        public byte[] DecodeWSQ() => _wsq.Decode(wsqBytes);
    }

    public class Program
    {
        static void Main(string[] args)
        {
            var summary = BenchmarkRunner.Run<DecodeBenchmark>();
        }
    }
}
